<script>

/**
 * jQuery Plugin: Sticky Tabs
 *
 * @author Aidan Lister <aidan@php.net>
 * adapted by Ruben Arslan to activate parent tabs too
 * http://www.aidanlister.com/2014/03/persisting-the-tab-state-in-bootstrap/
 */
(function($) {
  "use strict";
  $.fn.rmarkdownStickyTabs = function() {
    var context = this;
    // Show the tab corresponding with the hash in the URL, or the first tab
    var showStuffFromHash = function() {
      var hash = window.location.hash;
      var selector = hash ? 'a[href="' + hash + '"]' : 'li.active > a';
      var $selector = $(selector, context);
      if($selector.data('toggle') === "tab") {
        $selector.tab('show');
        // walk up the ancestors of this element, show any hidden tabs
        $selector.parents('.section.tabset').each(function(i, elm) {
          var link = $('a[href="#' + $(elm).attr('id') + '"]');
          if(link.data('toggle') === "tab") {
            link.tab("show");
          }
        });
      }
    };


    // Set the correct tab when the page loads
    showStuffFromHash(context);

    // Set the correct tab when a user uses their back/forward button
    $(window).on('hashchange', function() {
      showStuffFromHash(context);
    });

    // Change the URL when tabs are clicked
    $('a', context).on('click', function(e) {
      history.pushState(null, null, this.href);
      showStuffFromHash(context);
    });

    return this;
  };
}(jQuery));

window.buildTabsets = function(tocID) {

  // build a tabset from a section div with the .tabset class
  function buildTabset(tabset) {

    // check for fade and pills options
    var fade = tabset.hasClass("tabset-fade");
    var pills = tabset.hasClass("tabset-pills");
    var navClass = pills ? "nav-pills" : "nav-tabs";

    // determine the heading level of the tabset and tabs
    var match = tabset.attr('class').match(/level(\d) /);
    if (match === null)
      return;
    var tabsetLevel = Number(match[1]);
    var tabLevel = tabsetLevel + 1;

    // find all subheadings immediately below
    var tabs = tabset.find("div.section.level" + tabLevel);
    if (!tabs.length)
      return;

    // create tablist and tab-content elements
    var tabList = $('<ul class="nav ' + navClass + '" role="tablist"></ul>');
    $(tabs[0]).before(tabList);
    var tabContent = $('<div class="tab-content"></div>');
    $(tabs[0]).before(tabContent);

    // build the tabset
    var activeTab = 0;
    tabs.each(function(i) {

      // get the tab div
      var tab = $(tabs[i]);

      // get the id then sanitize it for use with bootstrap tabs
      var id = tab.attr('id');

      // see if this is marked as the active tab
      if (tab.hasClass('active'))
        activeTab = i;

      // remove any table of contents entries associated with
      // this ID (since we'll be removing the heading element)
      $("div#" + tocID + " li a[href='#" + id + "']").parent().remove();

      // sanitize the id for use with bootstrap tabs
      id = id.replace(/[.\/?&!#<>]/g, '').replace(/\s/g, '_');
      tab.attr('id', id);

      // get the heading element within it, grab it's text, then remove it
      var heading = tab.find('h' + tabLevel + ':first');
      var headingText = heading.html();
      heading.remove();

      // build and append the tab list item
      var a = $('<a role="tab" data-toggle="tab">' + headingText + '</a>');
      a.attr('href', '#' + id);
      a.attr('aria-controls', id);
      var li = $('<li role="presentation"></li>');
      li.append(a);
      tabList.append(li);

      // set it's attributes
      tab.attr('role', 'tabpanel');
      tab.addClass('tab-pane');
      tab.addClass('tabbed-pane');
      if (fade)
        tab.addClass('fade');

      // move it into the tab content div
      tab.detach().appendTo(tabContent);
    });

    // set active tab
    $(tabList.children('li')[activeTab]).addClass('active');
    var active = $(tabContent.children('div.section')[activeTab]);
    active.addClass('active');
    if (fade)
      active.addClass('in');

    if (tabset.hasClass("tabset-sticky"))
      tabset.rmarkdownStickyTabs();
  }

  // convert section divs with the .tabset class to tabsets
  var tabsets = $("div.section.tabset");
  tabsets.each(function(i) {
    buildTabset($(tabsets[i]));
  });
};

</script>

<style type="text/css">
img.leaflet-tile {
padding: 0;
margin: 0;
border-radius: 0;
border: none;
}
.leaflet .info {
padding: 6px 8px;
font: 14px/16px Arial, Helvetica, sans-serif;
background: white;
background: rgba(255,255,255,0.8);
box-shadow: 0 0 15px rgba(0,0,0,0.2);
border-radius: 5px;
}
.leaflet .legend {
line-height: 18px;
color: #555;
}
.leaflet .legend svg text {
fill: #555;
}
.leaflet .legend svg line {
stroke: #555;
}
.leaflet .legend i {
width: 18px;
height: 18px;
margin-right: 4px;
opacity: 0.7;
display: inline-block;
vertical-align: top;

zoom: 1;
*display: inline;

/b><\/br>PAYZAN Jean Charles.<\/br>","<b>LOU-4<\/b><\/br>.<\/br>","<b>LOU-2<\/b><\/br>.<\/br>","<b>BID-2<\/b><\/br>ITHURBIDE Jean Pierre.<\/br>","<b>BID-4<\/b><\/br>SALLABERRY Marie Thrse.<\/br>","<b>BID-6<\/b><\/br>ARROSSA Louisette.<\/br>","<b>BID-7<\/b><\/br>YBARGARAY Didier.<\/br>","<b>BID-9<\/b><\/br>AUCHOBERRY Xemartin.<\/br>","<b>BID-11<\/b><\/br>SABAROTS Anne Marie.<\/br>","<b>BID-5<\/b><\/br>ARROSSA Louisette.<\/br>","<b>BID-8<\/b><\/br>VIVAN Ccile.<\/br>","<b>BID-13<\/b><\/br>AMESTOY Paulette.<\/br>","<b>BID-14<\/b><\/br>LAFITTE Anne.<\/br>","<b>BID-10<\/b><\/br>POEYDESSUS Mikael.<\/br>","<b>BID-16<\/b><\/br>ORMAECHEA Roger.<\/br>","<b>BID-17<\/b><\/br>ORMAECHEA Roger.<\/br>","<b>BID-12<\/b><\/br>ORMAECHEA Roger.<\/br>","<b>BID-18<\/b><\/br>ORHATEGARAY Jean Marc.<\/br>","<b>BID-19<\/b><\/br>ORHATEGARAY Jean Marc.<\/br>","<b>BID-3<\/b><\/br>BIDEGARAY Christian.<\/br>","<b>BID-20<\/b><\/br>HEGUY Jean Noel.<\/br>","<b>BID-21<\/b><\/br>HEGUY Jean Noel.<\/br>","<b>BID-1<\/b><\/br>ETCHEVERRY Franois.<\/br>","<b>OST-1<\/b><\/br>MONTEMUIS Mathilde.<\/br>Cette parcelle appartient  Mme MONTEMUIS (fille + mre) qui est exploitante agricole (chvre, chevaux + autre). Elle a dj rcolt des chtaignes l'an dernier pour elle.  Elle est intresse pour les vendre (et pourquoi pas transformer un peu si la demande est l) MAIS elle veut tout d'abord tre sure des dbouchs avant de se lancer!! C'est primordial pour elle.  Elle souhaite valoriser cette parcelle. Il y a des chtaigniers, mais la parcelle est envahit par d'autres arbres qui ont t volontairement plants (htres et chnes rouges). Une ancienne clture est prsente mais en trs mauvais tat. Il n'y a pas d'accs propre direct avec une voiture (possibilit d'accs en tracateur par la prairie qui borde la parcelle), c'est encombr, mais la route est  proximit. Le verger est sain  70%. Cette parcelle pourrait avoir un intrt agronomique, pdagogique (formation etc) et un intrt patrimonial. Espacement chtaigniers = 15 m.","<b>OST-2<\/b><\/br>MONTEMUIS Mathilde.<\/br>La parcelle appartient  Mme MONTEMUIS qui est exploitante agricole (chvre, chevaux + autre). Elle a dj rcolt des chtaignes l'an dernier pour elle.  Elle est intresse pour les vendre (et pourquoi pas transformer un peu si la demande est l) MAIS elle veut tout d'abord tre sure des dbouchs avant de se lancer!! C'est primordial pour elle. La parcelle comprend au total une trentaine d'arbres. La clture est partielle (une partie seulement est grillage). Espacement chtaigniers = 3 rangs; 15m sur 5m.","<b>HEL-10<\/b><\/br>ARBELBIDE.<\/br>Cette parcelle a un sol argilo-siliceux qui est trs favorable pour les chtaigniers. L'accs y est possible  pied (possibilit d'arriver en 4x4  100m de la parcelle). Cette parcelle pourrait avoir un intrt agronomique, mais aussi pdagogique (c'est ici qu'ont dj eu lieu des formations de \"\"coupe\"\" des chtaigniers avec Gabriel DURRUTY. Attention, parcelle en pente donc mcanisation possible dans le sens de la pente. Nom maison prpritaire = \"\"Biskaia\"\". Espacement chtaigniers = 8-10m par 6-7m.","<b>HEL-9<\/b><\/br>ARBELBIDE.<\/br>Cette parcelle regroupe des chtaigniers gs. Le sol est argilo-siliceux et est donc trs favorable pour les chtaigniers. L'accs y est possible en 4x4 ou bien  pied. Cette parcelle pourrait avoir un intrt agronomique. Attention, parcelle en pente donc mcanisation possible dans le sens de la pente. Nom maison propritaire = \"\"Biskaia\"\".","<b>HAS-1<\/b><\/br>LYCEE AGRICOLE ARMAND DAVID.<\/br>Cette parcelle est un verger conservatoire. Les arbres ont t plant en 1994. Il en reste aujourd'hui une quarantaine. Le terrain est considr comme plat car il a t amnag avec des terrasses pour faciliter le passage des machines et le travail en gnral. Le verger est en pleine forme, on observe mme que le chancre est surmont par certains arbres. Ce verger a un intrt pdagogique, conomique, agronomique et est galement important pour les greffons. Espacement chtaigniers = 10m par 12m.","<b>HAS-2<\/b><\/br>ABALAGARAY.<\/br>Cette parcelle est la parcelle \"\"native\"\" , c'est un verger primaire o ont t plant 12 chtaigniers envoys depuis le Japon en 1910. Ces chtaigniers sont donc les originels. A cot de ces 12 originels, on peut observer 5-6 chtaigniers sauvages qui sont surement des hybrides F1. Une ancienne clture est prsente (barbel), mais elle est par terre et en trs mauvais tat. L'accs n'est pas possible en voiture, peut y accder  pied ou bien en tracteur de l'autre cot en passant par la prairie de l'exploitant. Ce verger a un intrt tout d'abord patrimonial et culturel, mais aussi pdagogique. Espacement chtaigniers = 10m de droite  gauche par 12-15m de haut en bas.","<b>HAS-3<\/b><\/br>ABALAGARAY.<\/br>Cette parcelle compte une dizaine d'arbres plants dans les annes 30's, et est situe en bord de route. Le verger est propre, les animaux doivent surement paturer la parcelle. Une cloture est prsente mais elle n'entoure pas seulement la chtaigneraies, elle entoute la totalit de la parcelle pture. Espacement chtaigniers = 5-6m.","<b>CAM-1<\/b><\/br>PIERY.<\/br>Cette parcelle appartient  un exploitant agricole qui fait du piment d'Espelette. Elle est compos d'environ 40 arbres (8 rangs de 5 arbres) qui ont t plants dans les annes 40's - 45's. Il n'y a pas de chemin trac pour arriver  la parcelle, mais cette dernire est situ d'une part en bord de route et d'autre part est accessible via une prairie. Elle est entretenue, il y a surement un paturage par les animaux qui a lieu car il n'y a pas de germe/repousse. Espacement chtaigniers = 10m.","<b>CAM-2<\/b><\/br>.<\/br>","<b>CAM-3<\/b><\/br>GOYTI.<\/br>Cette parcelle appartient  un exploitant agricole qui fait du piment d'Espelette. Elle est compos d'environ 25 arbres et est situe en bord de route. Espacement chtaigniers = 10m.  Propritaire intressant  rencontrer car son fils est dans l'arboriculture.","<b>HAS-5<\/b><\/br>.<\/br>","<b>HAS-4<\/b><\/br>Commune Hasparren.<\/br>Cette parcelle appartient  la mairie de Hasparren. Elle a t rcemment restaure (broyage etc) et fait 2ha-2,5ha. Elle est parfois en pente, mais c'est une parcelle accessible  90% en tracteur. Il y a plusieurs varits prsentes (35 Bouche de Btizac, 16 Prcoces Marigoule, 5 Bouches rouges, 40aine de Maridone, le reste en Marigoule + il y a aussi des plans issus du verger \"\"initial\"\" de Hasparren (hybrides naturels ou trs japonnais) + dernires varits INRA (Bellefer, Pollifer, Jeannette qui est un hybride Crenata/Sativa avec Molissima (chtaignier chinois), OG19). Cette parcelle a un intrt commercial, et agroenvironnemental (possibilit de faire faucher les fougres entre les chtaigniers par et pour un exploitant agricole).","<b>BRI-1<\/b><\/br>DUHAU Jean Claude.<\/br>Cette parcelle appartient  Mr DUHAU, retrait, qui habite \"\"Quartier de la fort\"\"  Briscous.  Il laisse les brebis d'un exploitant agricole de Perpignan pturer sur la parcelle (mais s'occupe galement un peu des brebis). La parcelle est en deux parties, les arbres ont t plant pendant l'hiver 2020-2021. Le terrain est en pente mais mcanisable. Plusieurs varits sont prsentes: Bouche de Btizac, Marigoule, et Maridonne. Sol lourd. Espacement chtaigniers = 10m par 10m.","<b>JAT-1<\/b><\/br>.<\/br>Cette parcelle appartient  un propritaire qui loue a une exploitante agricole de l'association \"\"Oihaneki quithrapie & fort\"\" (centre questre Cavalcadours de Jatxou) avec qui nous avons discut. La parcelle loue est relativement grande, mais la chtaigneraie ne couvre qu'une petite partie de la parcelle.  La parcelle est compose d'environ 120 arbres (une soixantaine d'hybrides japonnais d'un cot et une soixantaine d'hybride locaux de l'autre) qui ont t plants dans les annes 50's. La chtaigneraie est situe en bord de route. La parcelle pature est entoure d'une clture (haie) pour viter que les chevaux s'chappent, mais la chtaigneraie n'est pas clture au sens strict, les chevaux paturent alors sous les chtaigniers. Espacement chtaigniers = 5-6m (trop dense).  Le fait de ne pas connaitre l'hybride exact ne permet pas d'identifier le calibre du fruit. Mais selon la propritaire, les fruits ne sont pas trs gros, et c'est homogne.","<b>ESP-1<\/b><\/br>BENGOETCHEA.<\/br>Cette parcelle appartient  un propritaire d'un certain ge (que nous avons aperu) qui connait la valeur de la chtaigne. Il vendait auparravant ses chtaignes  Mr Itoiz mais ne le fait plus aujourd'hui. Il est trs intress par le projet Gaztaina et trs motiv (souhait de partager, de faire un systme collectif).  Trs intressant pour une mise en place de projet rapide, car sa parcelle qui compte une soixantaine d'arbres  l'hectare est adapte (terrain/accs) et productive (prs de 1,5 tonne de chtaigne par an selon Gabriel Durruty). La parcelle est pature par des vaches de race Aubrac (qui n'appartiennent pas au propritaire) + passage broyeur 1 fois/an (environ 700). Plantation dans les annes 40's. Sol: acide, non tass, et non humide. Cette parcelle pourrait avoir un intrt agronomique, et pdagogique (formation etc).","<b>ESP-2<\/b><\/br>Commune Espelette.<\/br>Cette parcelle appartient  la mairie d'Espelette et fat environ 100m de long (haut en bas) sur 120 de large (droite  gauche). Elle compte environ 200 arbres au total plants dans les annes 60's, avec une production estime selon Gabriel Durruty de 30  50kg de chtaigne/arbres. Une vieille clture et prsente mais en mauvais tat. L'accs peut se faire par en bas en bord de route ou par en haut via la prairie. Cette parcelle est totalement abandonne mais en tat elle pourrait avoir une bonne productivit (estimation 1  2 tonnes de farine/ha produite selon Mr Durruty). Selon lui, il faudrait: 1) Enlever les branches pour permettre le passage d'un gyrobroyeur, 2) Passage d'une gros gyrobroyeur pour nettoyer, 3) Elaguer les arbres. Parcelle saine, observation de schage sur les arbres  cause du manque de lumire. Espacement chtaigniers = 10m par 7m. ATTENTION: parcelle avec beaucoup de champignons, conflit?","<b>ESP-3<\/b><\/br>Commune Espelette+Mme MASSONDE.<\/br>Une partie de cette parcelle appartient  la mairie d'Espelette, et l'autre  Mme MASSONDE (tante de Baptiste MASSONDE) -->  voir cadastre pour sparer. Plantation des annes 60's. Existance d'une clture en mauvais tat, trs ancienne. La parcelle peut tre mcanisable notamment sur sa partie haute. Accs par le bord de la route ou par la prairie en haut. Les hybrides sont intressants selon Gabriel DURRUTY. La parcelle est saine et on observe une bonne viguer au niveau des repousses. Espacement chtaigniers = 15m entre rangs par 10-12m.","<b>SOU-1<\/b><\/br>MASSONDE.<\/br>La parcelle appartient  Mme Massonde (la tante de Baptiste). Les chtaigniers occupent environ 2500m, mais la parcelle est plus grande (10500m). Elle compte 25 chtaigniers environ qui ont t plant  la mme priode que la parcelle de Mme Massonde  Espelette (ESP_03). Il existe une clture pour la prairie situe  cot (et surement une pour la prairie en haut des chtaigniers) mais pas pour la parcelle de chtaigniers. Espacement chtaigniers = 15m par 7-8m. Certains arbres viennent d'tre coup pour nettoyer le passage dont des chtaigniers.","<b>SOU-2<\/b><\/br>EDANT Jrme.<\/br>Cette parcelle appartient  EDANT Jrme, mais il ne rpond pas  Gabriel DURRUTY. La totalit de la parcelle identifie sur QGIS fait environ 23,5ha MAIS les chtaigniers couvrent 2,5ha au sur et  sur plusieurs zones . Il n'y a pas de clture pour la chtaigneraie mais il en existe une pour la prairie. La route goudronne n'est pas  proximit mais un chemin accessible en voiture arrive jusqu' la maison, puis prsence d'un chemin aprs la maison (accessible en 4x4 ou  pied). L'accs peut aussi se faire par le haut de la parcelle.. Les chtaigniers sont des Crenata purs, issus d'un semi de 1914, la parcelle a donc un intrt historique, et les chtaigniers produisent de gros fruits. Le terrain est en pente mais mcanisable. Sol: argilo-siliceux, gravaleux. Atout commerce: proximit de Saint-Jean-de-Luz.","<b>ASC-1<\/b><\/br>GRACY.<\/br>Cette parcelle appartient au beau pre de Pascal Peyreblanque (qui fait parti de l'association Gaztaina) et il est intress par la dmarche. Il est exploitant agricole, ses brebis pturent sous les chtaigniers. Les chtaigniers plants en 1967, sont des hybrides qui sont trs japonnais et produisent de trs beaux fruits. La clture entoure l'ensemble de la prairie et pas uniquement la chtaigneraie. Espacement chtaigniers = 12m par 7m.","<b>ESQ-1<\/b><\/br>TOURREUIL Mat.<\/br>La parcelle appartient  des retraits (anciens exploitants agricoles), et est en trs bon tat. L'accs est difficile, il est possible en 4x4, tracteur ou  pied. L'accs est assez compliqu car le chemin (qui ne va pas jusqu' la chtaigneraie) est encombr par un cours d'eau. La parcelle est constitue de 47 arbres au total plants en 1965-1966 et se divise en 3 rangs. Elle est trs propre et les propritaires sont motivs pour faire quelque chose (vente par exemple). Espacement chtaigniers = 15m entre rangs par 8-10m.","<b>ALO-1<\/b><\/br>BIDALUN Aro.<\/br>La parcelle appartient  un retrait (ancien maon ) depuis 2014. Il est passionn par l'arboriculture. Il ne souhaite pas forcment vendre les produits issus de ses chtaigniers mais il souhaite entretenir sa parcelle et se faire plaisir. Il a plant d'autres arbres (pommiers etc), au total il y a environ une quarantaine de chtaigniers (jeunes et ags) sur sa parcelle. Son verger n'est donc pas  destination de produire mais il pourrait tre intressant commme \"\"conservatoire\"\" car le propritaire est trs intress par l'arboriculture, il cherche et repre les arbres et fruits intressants pour les greffer par la suite. Il fait de belles greffes. C'est une parcelle de chaptaigniers en devenir. Compliqu d'estimer le nombre d'arbres/ha car les plantations sont diverses.","<b>TRO-1<\/b><\/br>BOURDAARE.<\/br>Les chtaigniers de cette parcelle sont situs en pente, mais de l'autre cot il y a une route. Cela est problmatique et avantageux en mme temps. Problmatique car les chtaignes vont tomber sur la route. Avantageux car le terrain est en pente et la route permettrait une mcanisation possible.","<b>SAU-1<\/b><\/br>HOQUI Charles.<\/br>La parcelle compte 30 arbres. Une clture est prsente mais englobe la prairie. L'accs se fait par un chemin en 4x4 ou tracteur. L'envahissement est moyen.","<b>SAU-2<\/b><\/br>HOQUI Charles.<\/br>Une clture est prsente mais englobe la prairie. L'accs se fait par un chemin en 4x4 ou tracteur ET ensuite, il faut traverser la prairie (il n'y a pas de chemin). L'envahissement est moyen.","<b>SAR-1<\/b><\/br>DAUX Philippe, Marine Anne, Christine Marie.<\/br>La parcelle est en indivsion (famille DAUX, vrifi  la mairie de SARE). Elle est constitue de chtaigniers plants en 1920 environ  tendance forte Crenata :prsence Crenata pur (natifs comme Sourade) mais aussi des hybrides. Les chtaigniers natifs sont situs au Nord Est de la parcelle et les plus jeunes au Sud Ouest. La parcelle ets pature par les animaux. La clture est en trs mauvais tat. Espacement chtaigniers = 12m par 12m. ATTENTION: Selon Gbariel, ne pas oublier la mairie pour cette parcelle, car elle pourrait jouer un rle dans sa rhabilitation par exemple.","<b>ITX-1<\/b><\/br>DE ARIO.<\/br>La parcelle appartient  une propritaire qui vit  Bilbao (chercheuse  l'Universit Basque de Bilbao). La parcelle est trs envahit mais facile  nettoyer car les arbres osnt hauts donc possibilit de passer avec un gros broyeur. Trs bonne terre. Plantation des annes 40's. Espacement chtaigniers = 8m par 8m.","<b>ITX-2<\/b><\/br>LARRONDOA.<\/br>La parcelel appartient  un exploitant agricole qui faut du piment, et compte environ 30 chtaigniers. Prsence de ruches d'abeilles.","<b>ESP-4<\/b><\/br>IBARBURU Stphanie.<\/br>La parcelle appartient  une exploitante agricole, jeune, dynamique, qui produit du piment, qui a des brebis, des crisiers etc. Elle compte environ 20 chtaigniers au total. La cloture fait le touor de la parcelle car les brebis y pturent. Malgr ce pturage et une qualit de verger non envahi, il y a des branches mortes prsentes. Potentiel de production: environ 50kg/arbres selon Gabriel.","<b>ESP-6<\/b><\/br>EZCURRA Michel.<\/br>La parcelle appartient  un exploitant agricole qui fait de l'levage. Environ 30 arbres sont aligns en bord de route (espacement (6-7m), sur uen longueur de 200m. La prairie est en pente, la mcanisation y est difficile. Les arbres ont entre 40 et 50 ans environ.","<b>ESP-5<\/b><\/br>IBARBURU Stphanie.<\/br>La propritaire n'est pas sre  100% que la parcelle a t plante par l'Homme car les chtaigniers ne sont pas aligns. Selon elle, ses anctres ont pris des chtaignes de GAZ_ESP_04 et les ont dpos au sol sur cette parcelle. C'est une fort semi naturelle (il y a des arbres qui ont potentiellement tait plants par l'Homme et d'autres qui ont pousss seuls). La clture entoure une partie de la prairie (en bord de route) et pas la chtaigneraie. Si rhabilitation, alors il faut laguer certains arbres et en supprimer d'autres.","<b>CAM-5<\/b><\/br>ENS Dpartementaux.<\/br>La parcelle appartient aux Espaces Naturels Sensibles Dpartementaux. Peio LAMBERT gre les ENS. La parcelle est exploite par un agriculteur bovin qui fait pturer ses vaches. Le pre n'a pas de volont  valoriser les chtaigniers qui les a lagu  cause de l'ombre qu'ils lui faisaient. Il serait plus probable que le fils veuille les valoriser. Les arbres sont plants en ligne (45 chtaigniers) et d'autres (8 chtaigniers environ) sont situs  cot de l'alignement et sont disperss. Une clture existe pour les animaux au niveau de la prairie mais pas pour les chtaigniers. L'accs  la parcelle se fait par un chemin non goudronne possible avce un 4x4 ou un tracteur et ensuite  pied dans la prairie pour aller jusqu'aux chtaigniers. Espacement chtaigniers = 3m.","<b>CAM-6<\/b><\/br>Guillaume+Marianne?.<\/br>La parcelle appartient  de nouveaux propritaires, Guillaume et Marianne? Elle compte environ une vingtaine de chtaigniers situs dans le parc du Centre Mdical \"\"Les Terrasses\"\". Ces arbres produisent bien (environ 40kg/arbre selon Gabriel) et il y a dj eu rcolte faite par un tiers. L'entretien est rgulier (le tour des arbres est tondu rgulirement). Les arbres ont t plants pour enrichir l'espace et pas  vocation de production fruitire. Intrt pdagogique de cette parcelle. Sol moyen, argileux.","<b>CAM-4<\/b><\/br>HECQUET Sylvain.<\/br>ATTENTION cette parcelle n'a pas t observe par moi-mme, info par Gabriel et le propritaire. Cette parcelle appartient  un exploitant agricole qui a des brebis, des vignes, fait du piment, etc. Il est trs intressant et intress par l'tude, il pourrait tre intressant pour l'association Gaztaina (jeune, dynamique). Il a plant ses chtaigniers pas dans un objectif de produire des fruits mais plus  vocation forestire, mais les arbres produisent quand mme de belles chtaignes. Les chtaigniers sont plants trs serrs, c'est trs dense sur environ 1ha mais de manire assez disperse. Mme si les brebis et chevaux pture et entretiennent la parcelle, tant donne que les arbres sont plants trs serr, c'est du travail pour remettre en tat la parcelle si on veut la ddier  la production de fruits. L'aspect sanitaire ets moyen  cause de l'importance du trait local de ses chtaignes (proprice au dveloppement du chancre). L'accs peut se faire jusqu' la prairie avec un bon 4x4 puis  pied. La mcanisation n'est pas possible, un travail manuel serait plus adapt.  Espacement chtaigniers = 4m par 4m.","<b>MAC-32<\/b><\/br>LARREA.<\/br>Le propritaire a du matriel (filet etc) et sait travailler et cultiver la chtaigne. Il souhaite que sa fille reprenne la ferme. La parcelle est situe  proximit du domicile du propritaire. Elle compte environ 80 arbres et est entretenue mais prsence de branches mortes. Plantation des annes 60's mais aprs GAZ-SAU_01 et GAZ_SAU_02). Terre propice pour le chtaignier. Espacement chtaigniers = 15m par 12m. Ides Gbariel: Mr LARREA pourrait tre le ramasseur (car quip) et aller de maisons en maisons pour ramasser les chtaignes. De plus si Gbariel le lui demande, il pourrait participer  des journes pgagogiques pour prsenter son matriel, son utilisation etc. C'est un Homme peut bavard mais ds qu'il dit qu'il fait un truc il le fait. Selon Gbariel, il fabrique une calibreuse et son but est de faire chez lui ce que Itoiz a mis en place.","<b>MEN-14<\/b><\/br>IDIEDER Jean Pierre.<\/br>La parcelle appartient  un exploitant agricole d'levage porcins (EARL Uhaldia). C'est un \"\"conomiste\"\" qui pourrait tre intress par la production de chtaigne si a vaut le coup. La parcelle compte environ une quarantaine de chtaigniers issus de plans de chez Lafitte et de plans de son pre. Sol argilo siliceux-graveleux (bien pour chtaigniers). Clture : un fil car pturage par animaux, mais pas assez importante pour tre considre comme clture adapte pour une chtaigneraie.","<b>BON-1<\/b><\/br>ETCHEVERRY Michel.<\/br>Cette parcelle appartient  Mr ETCHEVERRY, le maire de Bonloc. Il a plant (sans ralis un alignement) plusieurs chtaigniers issus de plans de chez Lafitte il y a une vingtaine d'annes. L'accs se fait par un chemin existant mais qui n'est pas nettoy (accs  pied). La route est  environ 230m. Le terrain n'est pas entretenu donc envahis par de jeunes pousses (de chtaigniers et autres). Le chemin qui passe  cot de la parcelle pourrait devenir un lieu de balade.","<b>ALD-1<\/b><\/br>.<\/br>","<b>ALD-3<\/b><\/br>.<\/br>","<b>ALD-4<\/b><\/br>.<\/br>","<b>ALD-2<\/b><\/br>.<\/br>","<b>ALD-5<\/b><\/br>.<\/br>","<b>ALD-6<\/b><\/br>.<\/br>","<b>ALD-7<\/b><\/br>.<\/br>","<b>URE-1<\/b><\/br>.<\/br>","<b>URE-2<\/b><\/br>.<\/br>","<b>URE-3<\/b><\/br>.<\/br>","<b>URE-4<\/b><\/br>.<\/br>","<b>URE-5<\/b><\/br>.<\/br>","<b>URE-6<\/b><\/br>.<\/br>","<b>URE-7<\/b><\/br>.<\/br>","<b>URE-8<\/b><\/br>.<\/br>","<b>URE-9<\/b><\/br>.<\/br>","<b>URE-10<\/b><\/br>.<\/br>","<b>URE-11<\/b><\/br>.<\/br>","<b>URE-12<\/b><\/br>.<\/br>","<b>URE-13<\/b><\/br>.<\/br>","<b>URE-14<\/b><\/br>.<\/br>","<b>URE-15<\/b><\/br>.<\/br>","<b>URE-16<\
